const App = ({ notes }) => {
  console.log("NOTES", notes);
  return (
    <div className="test">
      {notes.map((e) => (
        <Note key={e.id} notes={e} />
      ))}
    </div>
  );
};

const Note = ({ notes }) => {
  console.log("NOTES2", notes);
  return (
    <>
      {notes.content} {notes.date}
    </>
  );
};
export default App;
